@xamoj

It's because all the Robin Hood 2010 releases out so far all use the same source for video, and most use the same audio source too, they just tweak everything to get it as good as it can possibly be. They all look similar because the source is too shitty to really make something out of (can't polish a turd).
TL:DR - ONE cam source, 100 "different" releases.
